import logo from './bryandelossantos.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
      <header className="App-header">
        
        <h1>
          
          My name is Bryan De Los Santos and I'm going to master React!
        </h1>

      </header>
    </div>
  );
}

export default App;
